export function datenow ()
{
    var d = new Date();
    var w
    var date = d.getDate();
    var month = d.getMonth() + 1;
    var year = d.getFullYear();
    var hour = d.getHours();
    var minutes = d.getMinutes();
    var seconds = d.getSeconds();
    var dateNow = date + "/" + month + "/" + year + " " + hour + ":" + minutes + ":" + seconds;
    return dateNow;
}
